import React from "react";
import { NavLink, Route, BrowserRouter } from "react-router-dom";
import s from "./EquipNavbar.module.css";

const EquipNavbar = () => {
    return (
        <div className="equipment">
            <h2 className={s.title}>Наше оборудование</h2>

            <NavLink to="/sound">Звук</NavLink>
            <NavLink to="/light">Свет</NavLink>
            <NavLink to="/effects">Спецэффекты</NavLink>
            <NavLink to="/complect">Комплекты</NavLink>
        </div>
    );
};

export default EquipNavbar;
